column11:
Cód. Bco. Corresp. na Compensação:
Caso o Beneficiário não tenha contratado a opção de Banco Correspondente com o Sicoob, preencher com '000';
Caso o Beneficiário tenha contratado a opção de Banco Correspondente com o Sicoob e a emissão seja a cargo do Sicoob (SEQ 17.3.P do Segmento P do Detalhe), preencher com '001' (Banco do Brasil) ou '237' (Banco Bradesco).
